import React, { useState, useEffect } from "react";
import CellDescription from "./celldescription";
import firebase from "firebase";

import Chart from "./../../images/Group 5.png";

function Cell({ cellID, notebook }) {
  const [cell, setCell] = useState(null);

  useEffect(() => {
    var cellRef = firebase.database().ref("notebooks/cells/" + cellID);
    cellRef.on("value", (snapshot) => {
      const data = snapshot.val();
      setCell(data);
    });
  }, [cellID]);

  return (
    <div className="cell-container">
      <div className="cell-options"></div>
      <div className="cell-output"> <img src={Chart}></img> </div>
      <CellDescription notebook={notebook} />
    </div>
  );
}

export default Cell;
